import React from "react";
import { MDBTableHead, MDBTable, TableBody } from "mdbreact";

class TablaDescuentos extends React.Component {
  state = {};

  render() {
    const data = {
      columns: [
        {
          label: "Legajo",
          field: "id"
        },
        {
          label: "Apellido y Nombre",
          field: "heading0"
        },
        {
          label: "Días a descuento",
          field: "heading1"
        }
      ]
    };
    return (
      <MDBTable responsiveSm>
        <MDBTableHead columns={data.columns} color="indigo" textWhite />
        <TableBody>
          {this.props.agentes.map((item, i) => {
            // if (item.diasdesc > 0) {
            return (
              <tr key={i}>
                <td className="text-center">{item.legajo}</td>
                <td>{item.nombre}</td>
                <td className="text-center">{item.diasdesc}</td>
              </tr>
            );
            // }
          })}
        </TableBody>
      </MDBTable>
    );
  }
}

export default TablaDescuentos;
